                        type='radio'
                        id='0'
                        name='0'
                        value='false'
                        checked={formData.CategorizedFlag === 'false'}
                        onChange={(e) => setFormData({ ...formData, CategorizedFlag: e.target.value })}
                    />
                    <label style={{ marginLeft: 7 }}
                        htmlFor='0'
                    >
                        No
                    </label>
                </div>

                <FormButton
                    style={{ marginLeft: 70 }}
                    className='btn btn-primary'
                    buttonText={'Previous'}
                    onClick={() => {
                        return setPage(page - 1);

                    }}
                />

                <FormButton
                    style={{ marginLeft: 241 }}
                    className='btn btn-success'
                    buttonText={'Submit'}
                    onClick={() => {
                        alert('Submit Successfully');
                        console.log(formData);
                        //console.log(typeof(formData.AccountTransactionID))

                    }}
                />

            </form> */}
            <RadioGroup aria-label="anonymous" name="anonymous" value={false} row>
  <FormControlLabel value="true" control={<Radio />} label="Yes" />
  <FormControlLabel value="false" control={<Radio />} label="No" />
</RadioGroup>
        </>
    )
}
